(function(){$('[id^="cite_note-"], [id^="cite_ref-"], .mw-headline[id]:not(.tcc-title > * > *)').each(function(){let a=$(this);mwDev.tools.hashControl.register(a.attr('id'),function(){let b=a.parents('.tcc-section, .mw-collapsible.mw-collapsed');if(b.length==0)return;$(b.get().reverse()).each(function(){$(this).hasClass('tcc-section')&&$(this).tabContentController('select')}),setTimeout(()=>$('html, body').animate({scrollTop:a[0].getBoundingClientRect().top+window.pageYOffset-70},500),100)},!0)})})()